css:
/* ANSI Grammar */
atom-text-editor .syntax--ansi-escape-code {
  font-size: 1px;
  color: rgba(0, 0, 0, 0);
}
atom-text-editor .syntax--ansi.syntax--green {
  color: #67f86f;
}
atom-text-editor .syntax--ansi.syntax--purple {
  color: magenta;
}
atom-text-editor .syntax--ansi.syntax--red {
  color: #cd0000;
}
atom-text-editor .syntax--ansi.syntax--yellow {
  color: #fffa72;
}
atom-text-editor .syntax--ansi.syntax--intensive {
  font-weight: bold;
}
